const baseURL = 'http://localhost:3000'

import axios from "axios"
import { provide } from "vue"

export default {
    getProviders() {
        var providers = []
        axios
        .get(`${baseURL}/providers`)
        .then(data => {providers.push(data.data)})
        providers.forEach((provider) => {console.log(provider)})
    }
}
